import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { TableContainer, Table, TableHeader, TableCell, TableRow, TableBody } from '@windmill/react-ui';

const SingleOrder = ({ match }) => {
  const [order, setOrder] = useState(null);
  const orderId = match.params.id; // Get the orderId from the route parameter

  useEffect(() => {
    const fetchOrder = async () => {
      try {
        const response = await axios.get(`http://localhost:8080/api/orders/${orderId}`);
        setOrder(response.data);
      } catch (error) {
        console.error('Error fetching order:', error);
      }
    };

    fetchOrder();
  }, [orderId]);

  if (!order) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>Order Details</h1>
      <TableContainer>
        <Table>
          <TableHeader>
            <tr>
              <TableCell>Field 1</TableCell>
              <TableCell>Field 2</TableCell>
              {/* Add more table headers for other fields */}
            </tr>
          </TableHeader>
          <TableBody>
            <TableRow>
              <TableCell>{order.field1}</TableCell>
              <TableCell>{order.field2}</TableCell>
              {/* Add more table cells for other fields */}
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default SingleOrder;
